import Change from "./Change/Change";
import Form from "./Form/Form";
import "./ProcessStyle.css"

export default function Process(props){
    function handleClick(){
        const tmp = false;
        props.onshowPopup(tmp);
    }
    return (
        <>
            <div id = "process">
                <button onClick={handleClick}>关闭</button>
                <Change />
                <Form />
            </div>
        </>
    );
}
